import React from 'react';
import TextField from '@material-ui/core/TextField';
const renderField = (
    {type, input, label, meta : { touched, error}}
    ) => (
        <TextField
            type = {type}
            label = {label}
            error = {touched && error}
            helperText={touched && error}
            variant="outlined"
            fullWidth
            {...input}
        />
)

export default renderField
